import React, { useState, useContext, useEffect } from 'react';
import Logo from '../../Assets/Logo/Logo';
import { FiSearch } from 'react-icons/fi';
import './Header.css';
import ModalLogin from '../Modal/ModalLogin/ModalLogin';
import { AuthContext } from '../../Context/AuthContext';
import { useNavigate, Link } from 'react-router-dom';
import DefaultAvt from '../../Assets/Logo/Logo';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Container from 'react-bootstrap/Container';

const Header = () => {
    const [showModal, setShowModal] = useState(false);
    const { user, logout } = useContext(AuthContext);
    const [balance, setBalance] = useState(0);
    const navigate = useNavigate();

    // ---- Handler functions ----
    const handleClickLogo = () => navigate('/');
    const handleClickMyOrders = () => navigate('/my-orders');
    const handleClickPageAccount = () => navigate('/account');
    const handleClickRecharge = () => { };
    const handleClickTransactionHistory = () => { };
    const handleClickLogout = () => {
        navigate('/');
        logout();
    };

    const handleLoginClick = () => setShowModal(true);
    const handleCloseModal = () => setShowModal(false);

    // ---- Effect update balance ----
    useEffect(() => {
        if (user?.balance) {
            setBalance(user.balance);
        } else {
            setBalance(0);
        }
    }, [user]);

    return (
        <Navbar expand="lg" className="header-container">
            <Container fluid className="header">
                {/* Logo */}
                <Navbar.Brand onClick={handleClickLogo} className="logo-container">
                    <img src={Logo.ImgLogo} alt="VUA Logo" className="logo" />
                </Navbar.Brand>

                {/* Search */}
                <div className="search-container">
                    <input type="text" className="search-input" placeholder="Tìm sản phẩm" />
                    <FiSearch className="search-icon" />
                </div>

                {/* Auth */}
                <div className="auth-container">
                    {!user ? (
                        <span onClick={handleLoginClick}>Đăng nhập / Đăng Ký</span>
                    ) : (
                        <div className="user-menu">
                            <NavDropdown
                                title={
                                    <div className="user-info">
                                        <img
                                            src={user.avatar || DefaultAvt}
                                            alt="avatar"
                                            className="avatar"
                                        />
                                        <span>{user.surname + ' ' + user.name}</span>
                                    </div>
                                }
                                id="user-nav-dropdown"
                                align="end"
                            >
                                <NavDropdown.Item onClick={handleClickPageAccount}>
                                    Trang Tài Khoản
                                </NavDropdown.Item>
                                <NavDropdown.Item onClick={handleClickMyOrders}>
                                    Đơn Hàng Của Tôi
                                </NavDropdown.Item>
                                <NavDropdown.Item onClick={handleClickRecharge}>
                                    Nạp Tiền
                                </NavDropdown.Item>
                                <NavDropdown.Item onClick={handleClickTransactionHistory}>
                                    Lịch Sử Giao Dịch
                                </NavDropdown.Item>
                                <NavDropdown.Divider />
                                <NavDropdown.Item onClick={handleClickLogout}>
                                    Đăng Xuất
                                </NavDropdown.Item>
                            </NavDropdown>

                            {/* Balance */}
                            <div className="balance-container">
                                <button className="balance-button">SỐ DƯ: {balance} đ</button>
                            </div>
                        </div>
                    )}
                </div>
            </Container>

            {/* Modal Login */}
            <ModalLogin show={showModal} handleClose={handleCloseModal} />
        </Navbar>
    );
};

export default Header;
